#!/usr/bin/env python3
import base64
import sys
import binascii

FXEEO_ENC = ""
ENC_METHOD = "self_enc"
ENC_METADATA = {'method': 'self_enc', 'shift_key': 17, 'salt': '2l1LQm1K', 'layers': 4}

ALPHABET = "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789!@#$%^&*()_+-=[]{}|;:,.<>?"

def decrypt_and_execute():
    try:
        current_data = FXEEO_ENC
        method = ENC_METADATA['method']
        
        if method == 'self_enc':
            # Reverse Layer 4
            decoded = base64.b64decode(current_data).decode('utf-8')
            salt = ENC_METADATA['salt']
            content = decoded[len(salt):-len(salt)]
            
            # Reverse Layer 3
            unscrambled = ""
            for i, char in enumerate(content):
                if i % 2 == 0:
                    unscrambled += char.lower()
                else:
                    unscrambled += char.upper()
            content = binascii.unhexlify(unscrambled).decode('utf-8')
            
            # Reverse Layer 2
            shift = ENC_METADATA['shift_key']
            unshifted = ""
            for char in content:
                if char in ALPHABET:
                    old_index = ALPHABET.index(char)
                    new_index = (old_index - shift) % len(ALPHABET)
                    unshifted += ALPHABET[new_index]
                else:
                    unshifted += char
            
            # Reverse Layer 1
            original = base64.b64decode(unshifted).decode('utf-8')
            
        elif method == 'multi_base64':
            current = current_data
            for i in range(4):
                current = base64.b64decode(current).decode('utf-8')
            original = current
            
        elif method == 'advanced_custom':
            # Reverse process
            current = base64.b64decode(current_data).decode('utf-8')
            current = current[::-1]
            current = base64.b64decode(current).decode('latin-1')
            original = ''.join(chr(ord(c) ^ ENC_METADATA['xor_key']) for c in current)
            
        elif method == 'hex_encoding':
            current = current_data
            for i in range(3):
                current = base64.b64decode(current).decode('utf-8')
            original = binascii.unhexlify(current).decode('utf-8')
            
        elif method == 'rot13_base64':
            current = current_data
            for i in range(3):
                current = base64.b64decode(current).decode('utf-8')
            original = current.encode('utf-8').decode('rot13')
            
        elif method == 'xor_base64':
            current = base64.b64decode(current_data).decode('utf-8')
            current = binascii.unhexlify(current).decode('utf-8')
            current = base64.b64decode(current).decode('latin-1')
            original = ''.join(chr(ord(c) ^ ENC_METADATA['xor_key']) for c in current)
            
        elif method == 'caesar_cipher':
            current = current_data
            for i in range(3):
                current = base64.b64decode(current).decode('utf-8')
            
            shift = ENC_METADATA['caesar_shift']
            original = ""
            for char in current:
                if char.isalpha():
                    ascii_offset = 65 if char.isupper() else 97
                    original += chr((ord(char) - ascii_offset - shift) % 26 + ascii_offset)
                else:
                    original += char
                    
        elif method == 'ultra_secure':
            # Reverse ultra secure process
            current = base64.b64decode(current_data).decode('utf-8')
            current = binascii.unhexlify(current).decode('utf-8')
            
            shift = ENC_METADATA['shift_key']
            unshifted = ""
            for char in current:
                if char in ALPHABET:
                    old_index = ALPHABET.index(char)
                    new_index = (old_index - shift) % len(ALPHABET)
                    unshifted += ALPHABET[new_index]
                else:
                    unshifted += char
            
            current = base64.b64decode(unshifted).decode('latin-1')
            original = ''.join(chr(ord(c) ^ ENC_METADATA['xor_key']) for c in current)
        
        # Execute the original code
        exec(original, globals())
        
    except Exception as e:
        print(f"Decryption error: {e}")

if __name__ == "__main__":
    decrypt_and_execute()
